import { TextField, Typography } from '@mui/material'
import React from 'react'

const TextfieldWithTitle = (props) => {
    return (
        <div>
            <Typography sx={{ ml: 0.5 }}>{props.title}</Typography>
            <TextField />
        </div>
    )
}

export default TextfieldWithTitle
